    while q in S:
        q = (q - 1) % p
        if q == digits[-1]:
            v = True
            break
    if v:
        return 0
    if q == 0:
        return p - digits[-1]
    elif q < digits[-1] and q == sp:
        w = False
        q = (q - 1) % p
        while q in S:
            q = (q - 1) % p
            if q == p - 1:
                w = True
                break
        if w:
            return p - digits[-1]
        else:
            return p + q - digits[-1]
    elif q < digits[-1]:
        return p + q - digits[-1]
    else:
        return q - digits[-1]

